```json
{
  "application": "WIEN2k",
  "other_software": [
    "PBS (Portable Batch System)",
    "tcsh (C Shell)"
  ],
  "resource_requirements": {
    "nodes": {
      "type": "integer",
      "description": "Number of nodes to be used for the job."
    },
    "ppn": {
      "type": "integer",
      "description": "Number of processes per node."
    },
    "walltime": {
      "type": "string",
      "format": "HH:MM:SS",
      "description": "Requested walltime for the job."
    },
    "queue": {
      "type": "string",
      "description": "Queue to submit the job to. Options are high, low, or local."
    },
    "resources": {
      "type": "string",
      "description": "Additional resources required for the job, specified in PBS format."
    },
    "scratch": {
      "type": "string",
      "description": "Scratch directory for the job. If not set, the environmental variable SCRATCH will be used."
    },
    "threads": {
      "type": "integer",
      "description": "Number of threads to be used for OpenMP parallelization."
    },
    "mpi": {
      "type": "integer",
      "description": "Number of processes used for MPI parallelization."
    },
    "wien2k_version": {
      "type": "string",
      "description": "Version of WIEN2k to be used for the job."
    }
  }
}
```
